import React from "react";
import { connect } from "react-redux";



class ConnectedList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            tombol: false
        }

        this.ontombol = this.ontombol.bind(this);

    }
    ontombol() {
        this.setState(prevState => ({
            tombol: !prevState.tombol
        }));
    }

    render() {

        

        return (
            <div>
                {this.state.map(() => (
                    <button key={this.state.id}>
                        {this.state.title}
                    </button>

                ))}

            </div>

        )
    }


}


const List = connect()(ConnectedList);
export default List;
